import React from 'react';

const CloudShopLogo = ({ 
  size = 'medium', 
  color = '#232F3E', 
  showText = true, 
  className = '',
  textColor = '#232F3E' 
}) => {
  const sizes = {
    small: { width: 24, height: 24, fontSize: '14px' },
    medium: { width: 32, height: 32, fontSize: '18px' },
    large: { width: 48, height: 48, fontSize: '24px' },
    xlarge: { width: 64, height: 64, fontSize: '28px' }
  };

  const currentSize = sizes[size] || sizes.medium;

  return (
    <div className={`cloud-shop-logo ${className}`} style={{ display: 'flex', alignItems: 'center', gap: '8px' }}>
      {/* Cloud Shopping Cart SVG Logo */}
      <svg
        width={currentSize.width}
        height={currentSize.height}
        viewBox="0 0 64 64"
        fill="none"
        xmlns="http://www.w3.org/2000/svg"
      >
        {/* Cloud Shape */}
        <path
          d="M48 28c0-8.837-7.163-16-16-16s-16 7.163-16 16c0 .338.011.673.032 1.006C13.77 30.274 12 32.48 12 35c0 3.314 2.686 6 6 6h30c4.418 0 8-3.582 8-8 0-4.418-3.582-8-8-8z"
          fill={color}
          opacity="0.8"
        />
        
        {/* Shopping Cart */}
        <g transform="translate(20, 24)">
          {/* Cart Body */}
          <path
            d="M4 4h16l-1.5 9H6.5L4 4z"
            fill="white"
            stroke={color}
            strokeWidth="1.5"
            strokeLinejoin="round"
          />
          
          {/* Cart Handle */}
          <path
            d="M4 4L2 2H0"
            stroke={color}
            strokeWidth="1.5"
            strokeLinecap="round"
            strokeLinejoin="round"
          />
          
          {/* Cart Wheels */}
          <circle cx="8" cy="18" r="1.5" fill={color} />
          <circle cx="16" cy="18" r="1.5" fill={color} />
          
          {/* Items in Cart */}
          <circle cx="10" cy="8" r="1" fill="#FF9500" />
          <circle cx="14" cy="9" r="1" fill="#FF6B35" />
          <circle cx="12" cy="7" r="0.8" fill="#4CAF50" />
        </g>
        
        {/* Digital/Tech Elements */}
        <g opacity="0.6">
          {/* Connection Lines */}
          <path
            d="M12 20L8 24M52 20L56 24"
            stroke={color}
            strokeWidth="1"
            strokeLinecap="round"
          />
          
          {/* Small Dots */}
          <circle cx="10" cy="18" r="1" fill={color} opacity="0.4" />
          <circle cx="54" cy="22" r="1" fill={color} opacity="0.4" />
          <circle cx="16" cy="45" r="1" fill={color} opacity="0.4" />
          <circle cx="48" cy="45" r="1" fill={color} opacity="0.4" />
        </g>
      </svg>
      
      {showText && (
        <span 
          style={{ 
            fontSize: currentSize.fontSize, 
            fontWeight: 'bold', 
            color: textColor,
            fontFamily: 'Arial, sans-serif',
            letterSpacing: '-0.5px'
          }}
        >
          SkyCart
        </span>
      )}
    </div>
  );
};

export default CloudShopLogo;
